import { React, useState } from "react";
import TextField from "@mui/material/TextField";
import './searchBar.scss'

const searchBar = () =>  {
    return(
        <div className="main">
            <h1>React Search</h1>
            <div className="search">
                <TextField 
                    id="outlined-basic"
                    variant="outlined"
                    fullWidth
                    label="Search"
                />
            </div>
        </div>
    )
}
export default searchBar
